import React from 'react';
import MenuItem from '../../menu-item/menuItem';
class Homepage extends React.Component {
	constructor() {
		super();
		this.state = {
			sections: [
				{
					title: 'hats',
					imgUrl: 'null',
					id: 1
				},
				{
					title: 'jackets',
					imgUrl: 'null',
					id: 2
				},
				{
					title: 'shoes',
					imgUrl: 'null',
					id: 3
				},
				{
					title: 'womens',
					imgUrl: 'null',
					id: 4
				},
				{
					title: 'mens',
					imgUrl: 'null',
					id: 5
				}
			]
		};
	}
	render() {
		return <div>{this.state.sections.map(({ title, id }) => <MenuItem key={id} title={title} />)}</div>;
	}
}
export default HomePage;
